import './App.css';
import axios from 'axios';
import { Button, Container } from 'react-bootstrap';
import { useState} from 'react';


function App() {

  const dates ={
    19991231:"1999-12-31",
    20000101:"2000-01-01",
    20000102:"2000-01-02",
    20000103:"2000-01-03",
  }

  const levels ={
    high:'2. high',
    low:'3. low'
  }
  const [result,setResult] = useState("")
  const [selectDate,setSelectDate]= useState(dates[1999123])
  const [selectLevel,setSelectLevel] = useState('2. high')
  const getData = () =>{
    const options = {
      method: 'GET',
      url: 'https://alpha-vantage.p.rapidapi.com/query',
      params: {
        interval: 'DAILY',
        function: 'TIME_SERIES_MONTHLY',
        symbol: 'AAPL',
        datatype: 'json',
        output_size: 'compact'
      },
      headers: {
        'X-RapidAPI-Key': '0f580a7692mshf1cde394489787ep110bedjsna00ae6955030',
        'X-RapidAPI-Host': 'alpha-vantage.p.rapidapi.com'
      }
    };

    axios.request(options).then(function (response) {

      const data = 'data'
      const month = 'Monthly Time Series'
      const date = selectDate
      const level = selectLevel
      const item_name =response[data][month][date][level];

      console.log(item_name)
      setResult(item_name)
      console.log(response.status);
    }).catch(function (error) {
      console.error(error);
    });

  }

    return (

      <div className="App ">
        <Container className='d-flex main-container'>
          <p className='m-3'>Select date to view apple stock price: </p>
          <select className='custom-select m-3' value = {selectLevel} onChange={e=>setSelectLevel(e.target.value)}>
            {Object.entries(dates).map(c => (
              <option value={c[1]}>{c[0]}</option>
            ))}
          </select>
          <select className='custom-select m-3' value = {selectDate} onChange={e=>setSelectDate(e.target.value)}>
            {Object.entries(dates).map(c => (
              <option value={c[1]}>{c[0]}</option>
            ))}
          </select>
          <Button className='btn m-2' onClick={getData}>Press</Button>
        </Container>
        <p className="results">{result}</p>
      </div>
    );
}

export default App;
